import React, { Component } from 'react';

class About extends Component {
    render() {
        return (
            <div className="container header">
                <div className="row">
                    <div className="col-lg-4 my-auto  text-center">
                        <h1>About</h1>
                    </div>
                </div>
            </div>
        );
    }
}

export default About;
